from datetime import datetime

# 创建两个datetime对象
datetime1 = datetime(2023, 10, 12, 12, 0, 0)  # 第一个时间
datetime2 = datetime(2024, 10, 13, 14, 30, 0)  # 第二个时间

# 计算时间差
time_difference = datetime2 - datetime1

# 提取时间差的总秒数
total_seconds = time_difference.total_seconds()

# 将秒数转换为小时
hours_difference = total_seconds / 3600

print(f"相差的小时数: {hours_difference} 小时")
